query:
/*+ NoHashJoin(mc t) NoHashJoin(mc t ci) */ select count(*)
from movie_companies AS mc
inner join title AS t
on t.id = mc.movie_id AND mc.company_id = 596 AND mc.company_type_id > 1 AND t.production_year < 2003
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id > 705067 AND ci.role_id > 2;
